import React, { Component } from "react";
import isEmpty from "../../validation/is_Empty";

class ProfileHeader extends Component {
  render() {
    console.log(this.props);

    const {
      name,
      avatar,
      status,
      company,
      location,
      youtube,
      twitter,
      facebook,
      instagram,
      linkedin
    } = this.props;
    return (
      <div className="row ">
        <div className="col-md-12">
          <div className="card  card-body bg-info mb-3">
            <div className="row">
              <div className="col-4 col-md-3 m-auto">
                <div style={{ display: "block" }}>
                  <img
                    src={avatar}
                    alt=""
                    className="rounded-circle mb-4   "
                    style={{
                      width: "150px",
                      border: "5px solid white"
                    }}
                  />
                  <div className=" text-center text-white h4">
                    {name}'s profile
                  </div>

                  <div className=" text-white">
                    {!(status === "0") ? (
                      <span>
                        {status} at {company}
                      </span>
                    ) : (
                      <span>Company {company}</span>
                    )}
                  </div>

                  <div className="text-white">{location}</div>

                  {/* {social links} */}

                  <div className=" text-white d-inline-flex p-2">
                    {facebook ? (
                      <a href={facebook}>
                        {" "}
                        <i className="fab fa-facebook fa-2x text-white p-2" />
                      </a>
                    ) : null}
                  </div>
                  <div className=" text-white d-inline-flex p-2">
                    {twitter ? (
                      <a href={twitter}>
                        {" "}
                        <i className="fab fa-twitter  fa-2x text-white" />
                      </a>
                    ) : null}
                  </div>
                  <div className=" text-white d-inline-flex p-2">
                    {youtube ? (
                      <a href={youtube}>
                        {" "}
                        <i className="fab fa-youtube  fa-2x text-white" />
                      </a>
                    ) : null}
                  </div>
                  <div className=" text-white d-inline-flex p-2">
                    {instagram ? (
                      <a href={instagram}>
                        {" "}
                        <i className="fab fa-instagram  fa-2x text-white" />
                      </a>
                    ) : null}
                  </div>
                  <div className=" text-white d-inline-flex p-2">
                    {linkedin ? (
                      <a href={linkedin}>
                        {" "}
                        <i className="fab fa-linkedin  fa-2x text-white" />
                      </a>
                    ) : null}
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
export default ProfileHeader;
